import './interfaces/IFastPool.sol';
import '../libraries/SafeMath.sol';
import '../erc20/ERC20.sol';
import 'hardhat/console.sol';

contract FastPool is IFastPool, ERC20{

  using SafeMath for uint256;
  address public override wrappedBitcoin;
  address public override fastRouter;
  mapping (uint=>uint) public override totalRequestedAmount;
  mapping (address => uint256) private _balances;
  mapping (address => mapping (address => uint256)) private _allowances;
  uint256 private _totalSupply;
  string private _name;
  string private _symbol;
  uint public override fastLimit;
  uint public override fastFee; // percentage of total amount 
  uint public override fastConfirmationParameter;
  address public override owner;

  modifier onlyOwner {
    require(msg.sender == owner);
    _;
  }

  constructor(
    address _wrappedBitcoin,
    address _fastRouter,
    string memory _name,
    string memory _symbol,
    uint _fastLimit,
    uint _fastFee,
    uint _fastConfirmationParameter,
    address _owner
  ) ERC20(_name, _symbol, 0) public {
    wrappedBitcoin = _wrappedBitcoin;
    fastRouter = _fastRouter;
    fastLimit = _fastLimit;
    fastFee = _fastFee;
    fastConfirmationParameter = _fastConfirmationParameter;
    owner = _owner;
  }

  function changeOwner(address _owner) external override onlyOwner {
    owner = _owner;
  }

  function setFastRouter(address _fastRouter) external override onlyOwner {
    fastRouter = _fastRouter;
  }

  function setFastLimit(uint _fastLimit) external override onlyOwner {
    fastLimit = _fastLimit;
  }

  function setFastFee(uint _fastFee) external override onlyOwner {
    fastFee = _fastFee;
  }

  function setFastConfirmationParameter(uint _fastConfirmationParameter) external override {
    fastConfirmationParameter = _fastConfirmationParameter;
  }

  function addLiquidity (address user, uint wrappedBitcoinAmount) public override returns (uint) {
    uint liquidity;
    uint totalWrappedBitcoin = totalWrappedBitcoin();
    if (totalWrappedBitcoin == 0) {
      liquidity = wrappedBitcoinAmount;
    } else {
      liquidity = wrappedBitcoinAmount*_totalSupply/totalWrappedBitcoin;
    }
    IERC20(wrappedBitcoin).transferFrom(msg.sender, address(this), wrappedBitcoinAmount);
    _mint(user, liquidity); // mint fast pool token for user
    emit AddLiquidity(user, wrappedBitcoinAmount);
    return wrappedBitcoinAmount;
  }

  function removeLiquidity(address user, uint fastPoolTokenAmount) public override returns(uint){
    require(_balances[msg.sender] >= fastPoolTokenAmount, "balance is not sufficient"); // cannot burn more than his fp token balance
    uint userShare = (totalWrappedBitcoin()*fastPoolTokenAmount)/_totalSupply;
    require(IERC20(wrappedBitcoin).transfer(user, userShare), "balance is not sufficient"); // give msg.sender his share of fees
    _burn(msg.sender, fastPoolTokenAmount); 
    emit RemoveLiquidity(user, userShare); // TODO: is user correct?
    return userShare;
  }

  function fastTransfer(address user, uint amount, uint blockNumber) override public returns(bool){
    require(msg.sender == fastRouter, "sender is not fast router");
    require((totalRequestedAmount[blockNumber] + amount) < fastLimit, "fast limit is reached");
    require(totalWrappedBitcoin() >= amount, "fast pool does not have enough balance");
    uint transferredAmount = amount*(100-fastFee)/100; // get fast fee from user
    IERC20(wrappedBitcoin).transfer(user, transferredAmount);
    totalRequestedAmount[blockNumber] = totalRequestedAmount[blockNumber] + amount;
    emit FastTransfer(user, amount, transferredAmount, blockNumber);
    return true;
  }

  function totalWrappedBitcoin() override public view returns(uint){
    return IERC20(wrappedBitcoin).balanceOf(address(this));
  }

}","keccak256":"0xb09866c55df2b5bf70f28b14c7c113430ddd4d4d2233caff1c9ff007fe4f79f1"},"contracts/pools/interfaces/IFastPool.sol":{"content":"// SPDX-License-Identifier: <SPDX-License>
pragma solidity ^0.7.6;

import '../../erc20/interfaces/IERC20.sol';

interface IFastPool is IERC20 {
  // events
  event AddLiquidity(address user, uint wrappedBitcoinAmount); 
  event RemoveLiquidity(address user, uint256 wrappedBitcoinAmount);
  event FastTransfer(address user, uint256 requestedAmount, uint256 transferredAmount, uint blockNumber);

  // read-only functions
  function owner() external view returns (address);
  function wrappedBitcoin() external view returns (address); // gives back the wrapped bitcoin address
  function fastRouter() external view returns (address);
  function fastFee() external view returns (uint);
  function fastLimit() external view returns (uint);
  function fastConfirmationParameter() external view returns(uint);
  function totalRequestedAmount(uint blockNumber) external view returns(uint);
  function totalWrappedBitcoin() external view returns(uint);

  // state-changing functions
  function changeOwner(address _owner) external;
  function setFastRouter(address _fastRouter) external;
  function setFastLimit(uint _fastLimit) external;
  function setFastFee(uint _fastFee) external;
  function setFastConfirmationParameter (uint _fastConfirmationParameter) external;
  function addLiquidity(address user, uint wrappedBitcoinAmount) external returns (uint);
  function removeLiquidity(address user, uint fastPoolTokenAmount) external returns (uint);
  function fastTransfer(address user, uint amount, uint blockNumber) external returns(bool);
}","keccak256":"0x215efef21f04db1979779766f5046217cb060f64df0e8ead3e27ad920ff8c4a1"},"contracts/routers/FastRouter.sol":{"content":"pragma solidity 0.7.6;

import '../erc20/interfaces/IERC20.sol';
import './interfaces/IFastRouter.sol';
import '../pools/FastPool.sol';
import '../pools/interfaces/IFastPool.sol';
import './interfaces/ICCTransferRouter.sol';
import '../libraries/SafeMath.sol';

contract FastRouter is IFastRouter {

    using SafeMath for uint;
    address public override bitcoinFastPool;
    address public override ccTransferRouter;
    address public wrappedBitcoin;
    address public override owner;

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    constructor (address _ccTransferRouter, uint _fastLimit, uint _fastFee, uint _neededConfirmations) public {
        ccTransferRouter = _ccTransferRouter;
        wrappedBitcoin = ICCTransferRouter(ccTransferRouter).wrappedBitcoin();
        FastPool _bitcoinFastPool;
        _bitcoinFastPool = new FastPool(
            wrappedBitcoin, 
            address(this), 
            "BitcoinFastPoolToken", 
            "BTCFPT", 
            _fastLimit, 
            _fastFee, 
            _neededConfirmations,
            msg.sender
        );
        bitcoinFastPool = address(_bitcoinFastPool);
        owner = msg.sender;
    }

    function changeOwner(address _owner) external override onlyOwner {
        owner = _owner;
    }

    function setCCTransferRouter(address _ccTransferRouter) external override onlyOwner {
        ccTransferRouter = _ccTransferRouter;
    }
    // it is called by cc transfer router
    function fastTransfer(address receiver, uint amount, uint blockNumber) external override returns(bool){
        require(msg.sender == ccTransferRouter, "message sender was not cc transfer router");
        require(IFastPool(bitcoinFastPool).fastTransfer(
                receiver,
                amount,
                blockNumber),
            "transfer was not succesfull"
        ); // transfer bitcoin to user
        return true;
    }

    function getNeededConfirmations() public view override returns(uint) {
        return IFastPool(bitcoinFastPool).fastConfirmationParameter();
    }

    function addLiquidity(address user, uint wrappedBitcoinAmount) external override returns(uint){
        require(IERC20(wrappedBitcoin).transferFrom(
            msg.sender, address(this), 
            wrappedBitcoinAmount), 
            "user balance is not sufficient"
        );
        require(IERC20(wrappedBitcoin).approve(
            bitcoinFastPool, 
            wrappedBitcoinAmount), 
            "fast router balance is not sufficient"
        );
        return IFastPool(bitcoinFastPool).addLiquidity(user, wrappedBitcoinAmount);
    }

    function removeLiquidity(address user, uint fastPoolTokenAmount) external override returns(uint) {
        require(IFastPool(bitcoinFastPool).transferFrom(
            msg.sender, address(this), 
            fastPoolTokenAmount), 
            "user balance is not sufficient"
        );
        return IFastPool(bitcoinFastPool).removeLiquidity(user, fastPoolTokenAmount);
    }

}
